svg.script:
if (window.tinyWidgets && window.tinyWidgets[document.currentScript.parentNode.id]) {
   const svgId = document.currentScript.parentNode.id;

   // required callback definition
   window.tinyWidgets[svgId].initSvg = function (cfg) {
	  const widget = window.tinyWidgets[svgId];
	  const svg = widget.container;
	  const svgStyle = svg.querySelector('style');
	  const animationsTop = document.getAnimations().filter((x) => x.animationName === 'pulse-grow-top');
      const animationsBottom = document.getAnimations().filter((x) => x.animationName === 'pulse-grow-bottom');
      const topKeyEl = svg.querySelector('.st27'); 
      const bottomKeyEl = svg.querySelector('.st84'); 
      let newBeatRate = 0, title, firstStart = true;

	  widget.svgjs.text(function (add) {
		 title = add.tspan('').dx(600).dy(80)
			.font({ size: 80, family: 'Source Sans Pro', anchor: 'start', weight: 600 })
			.fill(widget.theme === 'dark' ? '#ffffff' : '#3a474d');
	  });

	  // required propperty definition
	  widget.updateScheme = function (data) {
	     const _currentRate = newBeatRate;
		 const newestRecord = data[data.length - 1];
         newBeatRate = 60 / newestRecord.value / 2;
		 title.text(`${parseInt(newestRecord.value)} bmp`);
		 if (firstStart) {
            setCssValue(':root', '--beatrate-grow-top', `${newBeatRate}s`);
            setCssValue(':root', '--beatrate-grow-bottom', `${newBeatRate}s`);
            animationsTop.forEach((x) => { x.play(); });
            animationsBottom.forEach((x) => { x.play(); });
            firstStart = false;
        }
	  };

      // required propperty definition
	  widget.destroy = function () {
		 svg.removeEventListener('animationend', onAnimationEnd);
	  };

	  svg.addEventListener('animationend', onAnimationEnd);

	  function onAnimationEnd(event) {
	      if (newBeatRate === 0) return;

		  if (event.animationName === 'pulse-grow-top' && topKeyEl === event.target) {
             setCssValue(':root', '--beatrate-grow-top', `${newBeatRate}s`);
             animationsTop.forEach((x) => { x.play(); });
          }
          else if (event.animationName === 'pulse-grow-bottom' && bottomKeyEl === event.target) {
               setCssValue(':root', '--beatrate-grow-bottom', `${newBeatRate}s`);
               animationsBottom.forEach((x) => { x.play(); });
          }
	   }

	  function setCssValue(ruleName, prop, val) {
		 const rule = getCssRule(ruleName);
		 if (rule) rule.style.setProperty(prop, val);
	  }

	  function getCssValue(ruleName, prop) {
		 const rule = getCssRule(ruleName);
		 if (rule) return rule.style.getProperty(prop);
	  }

	  function getCssRule(ruleName) {
		 const ruleList = svgStyle.sheet.cssRules;
		 if (ruleList && ruleList.length > 0) {
			for (const rule of ruleList) {
			   if (rule.selectorText == ruleName) {
				  return rule;
			   }
			}
		 }
	  }
   }
}
